import React from 'react'
import { WrapperContainer } from './wrapper.styles'

const Wrapper = ({ column=false, children, width="100%" }) => {
  return (
    <WrapperContainer column={column} width={width}>
      {children}
    </WrapperContainer>
  )
}

export default Wrapper
